import axios from 'axios';
import { useForm, useFieldArray } from 'react-hook-form';
import { URL_CUS } from '../url';
import { useEffect, useState } from 'react';

const Add_chit = () => {
  const { register, control, handleSubmit } = useForm({
    defaultValues: {
      chit_det: { chit_name: '', Tolal_amount: '', Due_amount: '', time_preiod: '' },
      member_list: [{ name: '' }],
    },
  });

  const { fields, append, remove } = useFieldArray({
    control,
    name: 'member_list',
  });

  const [list, setCuslist] = useState([]);

  const datalistId = (index) => `datalist-${index}`;

  const member_list = async () => {
    try {
      const res = await axios.get(URL_CUS);
      setCuslist(res.data);
      console.log(res.data);
    } catch (error) {
      console.error('Error fetching customer list:', error);
    }
  };

  useEffect(() => {
    member_list();
  }, []);

  const onSubmit = async(data) => {
    console.log(data);

    try {
      // Assuming your server expects data in the following format
      const requestData = {
        chit_det: data.chit_det,
        member_list:data.member_list,
      };

      // Send data to the server using Axios
      const response = await axios.post(URL_CUS, requestData);

      console.log('Server Response:', response.data);
      // You can handle the server response here if needed
    } catch (error) {
      console.error('Error while submitting data:', error);
      // Handle error appropriately
    }
  };

  const onAddProduct = () => {
    append({ name: '' });
  };

  return (
    <form onSubmit={handleSubmit(onSubmit)}>
        <div className='col-4'>
          <div>
            <label>Chit Name:</label>
            <input {...register('chit_det.chit_name')} placeholder="Chit Name" />
          </div>
          <div>
            <label>Chit Amount:</label>
            <input {...register('chit_det.Tolal_amount')} placeholder="Total Amount" type="email" />
          </div>
          <div>
            <label>Due Amount:</label>
            <input {...register('chit_det.Due_amount')} placeholder="Due Amount" />
          </div>
          <div>
            <label>Time Preiod:</label>
            <input {...register('chit_det.time_preiod')} placeholder="Time Preiod" />
          </div>
        </div>

      <div className="col-2">
        <table>
          <tbody>
            {fields.map((item, index) => (
              <tr key={item.id}>
                <td>
                  <input
                    {...register(`member_list.${index}.name`)}
                    placeholder="Member Name"
                    list={datalistId(index)}
                  />
                  <datalist id={datalistId(index)}>
                    {list.map((option, optionIndex) => (
                      <option key={optionIndex} value={option.name}>
                        {option.name}
                      </option>
                    ))}
                  </datalist>
                </td>
                <td>
                  <button type="button" onClick={() => remove(index)}>
                    Remove
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
        <button type="button" onClick={onAddProduct}>
          Add Member
        </button>
      </div>

      <button type="submit">Submit</button>
    </form>
  );
};

export default Add_chit;
